INSERT INTO `course` VALUES (5,'2023-04-14 21:59:00','Unlock your potential in SAP Consulting. Build the core skills SAP Partners and customers are searching for across the world, and kick-start an exciting SAP career.','2023-04-30',_binary '','https://www.coursera.org/professional-certificates/sap-technology-consultant','SAP Technology Consultant Professional Certificate',0,'2023-04-10',' Martin Gollogly','2023-04-14 21:59:00',3),(6,'2023-04-14 22:00:55','Emerging Digital Technologies in Manufacturing. Learn about breakthrough digital technologies in manufacturing and the business value they deliver.','2023-04-30',_binary '','https://www.coursera.org/specializations/digital-technologies-future-of-manufacturing','Digital Technologies and the Future of Manufacturing Specialization',0,'2023-04-14','M.S. Krishnan','2023-04-14 22:00:55',3),(7,'2023-04-14 22:03:57','Learn in-demand skills like Python, Git, and IT automation to advance your career','2023-04-30',_binary '','https://www.coursera.org/professional-certificates/google-it-automation','Google IT Automation with Python Professional Certificate',14,'2023-04-14','Google Career Certificates','2023-04-14 22:03:57',3),(8,'2023-04-14 22:05:27','Kickstart a new IT and Cloud Career . Master hardware, operating systems, programming, database, networking, storage, cybersecurity, and Cloud computing essentials.','2023-04-30',_binary '','https://www.coursera.org/specializations/it-cloud-fundamentals','Information Technology (IT) and Cloud Fundamentals Specialization',39,'2023-04-14','Skills Network','2023-04-14 22:05:27',3),(9,'2023-04-14 22:07:25','In this 2-hour long project-based course, you will learn how to examine the company’s performance on a yearly basis, as well as against their peers. The learners will be able to analyze the company’s performance in terms of profitability, liquidity, activity, and solvency. The learners then will be able to communicate their findings.  Note: This course works best for learners who are based in the North America region. We\'re currently working on providing the same experience in other regions.  This course\'s content is not intended to be investment advice and does not constitute an offer to perform any operations in the regulated or unregulated financial market.','2023-04-30',_binary '','https://www.coursera.org/projects/analyze-company-performance-ratios','Analyzing Company Performance using Ratios',0,'2023-04-14','Coursera','2023-04-14 22:07:25',4),(10,'2023-04-14 22:09:11','Welcome to Fundamentals of Finance. This 4 module course will help you understand and affect the performance of your unit or organization’s profitability. By the end of this course, you will be able to implement finance and accounting concepts to drive your organization\'s growth, analyze financial statements and understand the factors in productivity and profitability, and create forecasting and budgeting. You will also have the ability to evaluate and manage cash flow, implement strategies around financing, and use of ratios in running a business.','2023-04-30',_binary '','https://www.coursera.org/learn/finance-fundamentals-uci','Fundamentals of Finance',49,'2023-04-14',' Marla Noel','2023-04-14 22:09:11',4),(11,'2023-04-14 22:10:28','Advance Your Knowledge in Financial Engineering . Build the fundamentals and technical skills in financial engineering','2023-04-30',_binary '','https://www.coursera.org/specializations/financialengineering','Financial Engineering and Risk Management Specialization',79,'2023-04-14','Garud Iyengar','2023-04-14 22:10:28',4),(12,'2023-04-14 22:14:04','Ecology, Ecosystem, Sustainability, Climate change, Circular Economy, Ecologist, Environmental Science, Biology','2023-04-30',_binary '','https://www.udemy.com/course/ecology-ecosystem-climate-change-sustainability-environmental-science/','Master course in Ecology, Ecosystem and Climate Change 2.0',11.2,'2023-04-14','Dr. José J','2023-04-14 22:14:04',5),(13,'2023-04-14 22:16:13','After taking this basic course, you will understand what the circular economy is, where it originated, how to discover circular ideas and how to create value. You will also discover where to look for financing and how to take the first step. I saved the best for the end. You will end the course very inspired and ready to change your corner of the world.','2023-04-30',_binary '','https://www.udemy.com/course/the-circular-economy/','The Circular Economy',13.5,'2023-04-14','Dr Gordana Kierans','2023-04-14 22:16:13',5),(14,'2023-04-14 22:17:38','A Course Designed to Give You a Better Understanding International Business--Perfect for University and Adult Learners!','2023-04-30',_binary '','https://www.udemy.com/course/brad-cartwright-international-economics/','International Economics: A Comprehensive Economics Course',13.5,'2023-04-14','Brad Cartwright','2023-04-14 22:17:38',5),(15,'2023-04-14 22:19:40','Drawing is not a talent. It\'s a skill anyone can learn.','2023-04-30',_binary '','https://www.udemy.com/course/the-art-and-science-of-drawing/','The Art & Science of Drawing / BASIC SKILLS',16.2,'2023-04-14','Brent Eviston','2023-04-15 09:21:13',8),(16,'2023-04-14 22:31:32','This is an actual college level course that is taught at several accredited colleges','2023-04-30',_binary '','https://www.udemy.com/course/art-history-survey-1300-to-contemporary/','Art History Renaissance to 20th Century',20.5,'2023-04-14','Kenney Mencher','2023-04-15 09:22:31',8),(17,'2023-04-14 22:42:35','Incorporating structure & stability through consistent classroom management strategies pivotal for teaching & education','2023-04-30',_binary '','https://www.udemy.com/course/classroom-management/','Classroom Management - Fundamentals of Teaching & Education',15.8,'2023-04-14','Scott Graham','2023-04-14 22:42:35',6),(18,'2023-04-14 22:45:28','Redesign The Education','2023-04-30',_binary '','https://www.udemy.com/course/teacher-training-course/','Teacher Training Course - Tomorrow\'s Teacher',14,'2023-04-14','Yarının Eğitimi','2023-04-14 22:45:28',6),(19,'2023-04-14 22:47:33','Learn how to think the way mathematicians do – a powerful cognitive process developed over thousands of years.  Mathematical thinking is not the same as doing mathematics – at least not as mathematics is typically presented in our school system. School math typically focuses on learning procedures to solve highly stereotyped problems. Professional mathematicians think a certain way to solve real problems, problems that can arise from the everyday world, or from science, or from within mathematics itself. The key to success in school math is to learn to think inside-the-box. In contrast, a key feature of mathematical thinking is thinking outside-the-box – a valuable ability in today’s world. This course helps to develop that crucial way of thinking.','2023-04-30',_binary '','https://www.coursera.org/learn/mathematical-thinking','Introduction to Mathematical Thinking',49,'2023-04-14','Dr. Keith Devlin','2023-04-14 22:47:33',6),(20,'2023-04-14 22:51:01','Learn maths in simple, easy to understand chunks that you can build together and apply to real-life situations.  This  is a complete set of lessons made forr students of any level and any age to learn all about fractions.  I start by looking at how to find a fraction of a whole number, and  then lead onto further topics involving fractions, ending with a section  full of mixed practice questions.  Each lesson is kept short and simple, so that even the busiest student can learn. All you have to do is watch one three-minute lesson a day, and you\'ll be amazed at how much you pick up and remember.','2023-04-30',_binary '','https://www.skillshare.com/en/classes/3-Minute-Maths-Fractions/539833341?via=search-layout-grid','3 Minute Maths - Fractions',0,'2023-04-14','Kieran Ball','2023-04-14 22:51:01',6),(21,'2023-04-15 07:50:44','Learn how to report and communicate credibly on your company CSR activities. Decode the “responsible” ads, labels and certifications of the products around you.','2023-04-16',_binary '','https://www.edx.org/course/csr-reporting-and-communication?index=product&search_index=product&webview=false&campaign=CSR+Reporting+and+Communication&source=edX&product_category=course&placement_url=https%3A%2F%2Fwww.edx.org%2Flearn%2Fbusiness-communications','CSR Reporting and Communication',0,'2023-04-15','Valérie Swaen','2023-04-15 07:50:44',10),(22,'2023-04-15 07:54:26','Businesses cannot function without communication. Communication is required to connect with people within an organisation or unit and with the outside world. Communication is a two-way process. This lesson provides a complete structure and process of communication with special reference to communication in organisations. It discusses various factors in Business Communication and explains the communication process including different communication networks with their utilities. It also provides valuable inputs to overcome the barriers to communication to make it more effective.','2023-05-15',_binary '','https://www.edx.org/course/the-abc-of-business-communication?index=product&search_index=product&webview=false&campaign=The+ABC+of+Business+Communication&source=edX&product_category=course&placement_url=https%3A%2F%2Fwww.edx.org%2Flearn%2Fbusiness-communications','The ABC of Business Communication',0,'2023-04-15','SHOBHA BHOBE','2023-04-15 07:54:26',10),(23,'2023-04-15 08:08:25','Everyone tells stories—that’s how we build community and share ideas. However, we don’t always communicate our story as effectively as we intend to.  Communication in the workplace may take the form of business writing, email communications, in-person discussions, non-verbal communication, public speaking, and even telling stories.  The Communication Skills Professional Certificate program focuses on effective business communication skills employers value most, from crafting a powerful story to creating impactful presentations and using tools for public speaking.','2023-06-15',_binary '','https://www.edx.org/professional-certificate/ritx-communication-skills?index=product&search_index=product&webview=false&campaign=Communication+Skills&source=edX&product_category=professional-certificate&placement_url=https%3A%2F%2Fwww.edx.org%2Flearn%2Fbusiness-communications','Take your communication skills to the next level',537.3,'2023-04-15','Keith B. Jenkins | Lori Marra | Andrea Hi | Kari Cameronckerson | Thomas Dooley','2023-04-15 08:08:25',10),(24,'2023-04-15 08:17:13','As we head towards the digital age, the need for digital marketers who can market/sell online has grown exponentially. That is where a digital marketing course comes into the picture.  Unlike a traditional degree, you just need to invest 4-6 months in a digital marketing course online, get certified & enter the job market confidently. And you know what the best part is? The best part about an online digital marketing course is that you can upskill and pursue your college degree side by side without ever feeling overwhelmed by doing two things at once.','2023-08-15',_binary '','https://iide.co/online-digital-marketing-course/','Online Digital Marketing Course with Certificate & Placements',0,'2023-04-17','Rushabh Sheth | Arpit Jain | Anish Raul | Amyn Ghadiali | Karan Shah | Aneri Joshi | Nikhil Punjabi | Daksh Juneja','2023-04-15 08:18:46',9);
